t things of a long time ago, that I I am the Divine and there is no other God, nor any like me; He who announces the term from the beginning, and from a long time ago the things that have not been done; He who says: ' My own counsel will take effect, and I will do whatever is my delight ' ′′ (Isaiah 46:9, 10). Jehovah said he will fulfill his purpose through the Messiah. Who on earth could stop him? If you would like more information visit the official website of Jehovah’s Witnesses at www.jw.org",
